layered_data = {}
for entry in data:
    if entry['layer'] not in layered_data:
        layered_data[entry['layer']] = []
    layered_data[entry['layer']].append(entry)

# Create plots for each layer
for layer_name, entries in layered_data.items():
    # Extract data
    sequences = [entry['sequence'] for entry in entries]
    max_values = [entry['max_value'] for entry in entries]
    max_value_channels = [entry['max_value_channel'] for entry in entries]
    
    # Create a 3D plot
    fig = plt.figure()
    ax = fig.add_subplot(111, projection='3d')
    
    # Create a scatter plot
    sc = ax.scatter(sequences, max_value_channels, max_values, c=max_values, cmap='viridis', alpha=0.8)
    
    # Add labels
    ax.set_xlabel('Sequence (Token ID)')
    ax.set_ylabel('Max Value Channel')
    ax.set_zlabel('Max Value')
    
    # Add color bar to show value range
    cbar = plt.colorbar(sc)
    cbar.set_label('Max Value')
    
    # Save the plot
    plt.savefig(f'layer_{layer_name}.png')  # Modified filename for clarity
    plt.close()  # Close the figure to free memory
    print(f"Saved plot for layer {layer_name} as 'layer_{layer_name}.png'.")
